import React from 'react';
import sobe from '../images/icon-sobe.png';
import desce from '../images/icon-desce.png';

export const Informacoes = (props) => {
  return (
    <div className="container-informações">
      <h3>{props.titulo}</h3>
      {props.texto}

      <div className="navegacao">
        <img className='navegacao-img' src={sobe} onClick={props.handleSobe} alt="Seta para cima" />
        <img className='navegacao-img' src={desce} onClick={props.handleDesce} alt="Seta para baixo" />
      </div>
    </div>
  );
}
